// src/pages/Blog.js
import React from 'react';

function Blog({ posts }) {
  return (
    <div>
      {posts.map(post => (
        <div key={post.id}>
          <h2>{post.title}</h2>
          <p>{post.description}</p>
          {/* Exiba outras informações do post conforme necessário */}
        </div>
      ))}
    </div>
  );
}

export default Blog;
